import React from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import { FaArrowLeft, FaSearch } from 'react-icons/fa';


const SupportPage = () => {
const navigate = useNavigate();
  const [searchQuery, setSearchQuery] = React.useState('');

  const supportCategories = [
    'Connectivity Issues',
    'Energy Monitoring Inaccuracies',
    'Notifications and Alerts',
    'Firmware and Updates',
    'Account and Data Issues',
    'Statistics and Reports',
    'Rewards and Incentives',
    'Others'
  ];

  return (
    <div className="support-container">
      <header className="gradient-header support">
        <button className="back-button" onClick={() => navigate('/settings')}><FaArrowLeft /></button>
        <h1>Support</h1>
      </header>
      <div className="support-content">
        <h2>How can we help?</h2>
        <div className="search-bar">
          <FaSearch className="search-icon" />
          <input 
            type="text" 
            placeholder="Search Support Topics"
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
        </div>
        <div className="categories-list">
          {supportCategories.map((category, index) => (
            <button key={index} className="category-item">
              {category}
              <span className="arrow">â€º</span>
            </button>
          ))}
        </div>
      </div>
    </div>
  );
};

const App = () => (
  <Router>
    <Routes>
      <Route path="/support" element={<SupportPage />} />
    </Routes>
  </Router>
);

export default App;
